import React, { Component } from 'react';

import Navbar from '../Components/Navbar';

class Contact extends Component {
    render() {
        return (
            <div>
                <Navbar />
                <div class="container">
                    <h1>Phone: 843-271-3434</h1>
                </div>
            </div>
        )
    }
}

export default Contact;
